import classes from './Header.module.css';
import logo from '../../images/logo.png';
import PageTab from './PageTab';
import { useSpring, animated } from 'react-spring';


const Header = () => {
    const props = useSpring({ to: {opacity: 1, marginTop: 0}, from : {opacity: 0} });
    return (
            <animated.div style={props}>
                <header className={classes.header}>   
                    <div className={classes.topHeader}>
                        <span className={classes.heading}>Motus</span>
                        <span><img className={classes.logo} src={logo} alt="Logo"/></span>
                        <span className={classes.heading}>Osteo</span>
                    </div>
                    <div className={classes.bottomHeader}>
                        <PageTab tabName="About Us" path="/"/>
                        <PageTab tabName="Our Team" path="/team"/>
                        <PageTab tabName="Appointments" path="/appointments"/>
                    </div>
                </header>
            </animated.div>
    )
}

export default Header
